import React, {useState} from 'react';
import {Link} from 'react-router-dom';

function Navbar() {
  return (
    <nav className="navbar">
      <div className="navbar__wrapper">
          <Link to="/" className="navbar__logo">
              LOGOHERE
          </Link>
      </div>
    </nav>
  );
}

export default Navbar;
